import React, { Component } from 'react';
import DiyInfo from './Diyinfo';
import { Pagination, PaginationItem, PaginationLink } from 'reactstrap';

class DiyList extends Component{
    static defaultProps = {
        data: [],
    }

    render(){
        const { category } = this.props;
        const { data } = this.props;
        const motorList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );
        const wingsList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );

        const frameList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );
        const controlBoardList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );
        const escList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );
        const batteryList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );
        const antennaList = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );


        return(
            <div>
                <h2>List</h2>
                {
                    (()=> {
                        if (category === 1) return (<div> motor {motorList} </div>);
                        if (category === 2) return (<div> wings {wingsList} </div>);
                        if (category === 3) return (<div> frame {frameList} </div>);
                        if (category === 4) return (<div> control board{controlBoardList} </div>);
                        if (category === 5) return (<div> esc {escList} </div>);
                        if (category === 6) return (<div> battery {batteryList} </div>);
                        if (category === 7) return (<div> antenna {antennaList} </div>);
                    })()
                }
                <Pagination aria-label="Page navigation example">
                    <PaginationItem>
                        <PaginationLink previous href="#" />
                    </PaginationItem>
                    <PaginationItem>
                        <PaginationLink href="#">
                            1
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                        <PaginationLink href="#">
                            2
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                        <PaginationLink href="#">
                            3
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                        <PaginationLink href="#">
                            4
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                        <PaginationLink href="#">
                            5
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                        <PaginationLink next href="#" />
                    </PaginationItem>
                </Pagination>
            </div>
        );
    }
}

export default DiyList;
